    private PhenomenonEnum(
            int id, 
            int phenomenonTypeId, 
            String phenomenonType, 
            int categoryId, String category) {
        
        this.id = id;
        this.phenomenonTypeId = phenomenonTypeId;
        this.phenomenonType = phenomenonType;
        this.categoryId = categoryId;
        this.category = category;
        
    }
    

    public int getId() {
        return id;
    }    

    public int getPhenomenonTypeId() {
        return phenomenonTypeId;
    }
    
    public String getPhenomenonType() {
        return phenomenonType;
    } 
    
    public int getCategoryId() {
        return categoryId;
    }
    
    public String getCategory() {
        return category;
    }     
    
